import React from 'react'
import styled from 'styled-components';
import Link from 'next/link';
import Typography from '@material-ui/core/Typography';
import ExpandMoreOutlinedIcon from '@material-ui/icons/ExpandMoreOutlined';
import HeroSection from '../components/HeroSection';

import { StyledPage, StyledBanner, StyledContainer } from '../components/styles/PageStyles';

const StyledDiv = styled.div`
    .privacyPolicy{

        color: ${props => props.theme.primary};
        font-size: 2rem;
        font-family: ${props => props.theme.MPLight};
    &-title{
        color: ${props => props.theme.primary};
        font-family: ${props => props.theme.MPSemibold};
        font-size: 4.4rem;
        margin-top: 3rem;
        margin-bottom: 3rem;
    }

    &_sub-title{
        color: ${props => props.theme.primary};
        font-size: 3.5rem;
        font-family: ${props => props.theme.MPLightIt};
        padding-bottom: .5rem;
        margin-top: 3rem;
        margin-bottom: 3rem;
    }
    &-bold{
        font-family: ${props => props.theme.MPBold};
    }
    &-it{
        font-family: ${props => props.theme.MPLightIt};
    }
    }
`;

export default () => (
    <>
        <HeroSection >
            Privacy policy
    </HeroSection>
        <StyledPage>
            <StyledDiv>
                <Typography gutterBottom className="disclaimer-title"> Privacy policy</Typography>
                <Typography gutterBottom className="disclaimer"></Typography>
                <Typography gutterBottom className="disclaimer">A</Typography>
                <Typography gutterBottom className="disclaimer"></Typography>
                <Typography gutterBottom className="disclaimer"></Typography>
                <Typography gutterBottom className="disclaimer"></Typography>
                <Typography gutterBottom className="disclaimer"></Typography>
            </StyledDiv>

        </StyledPage>
    </>
);
